comment:
This 30 day challenge has really been beneficial in ways that I did not imagine. I have Dupuytren's Contracture and/or trigger finger in all of my fingers and have had 5 surgeries so far. Sometimes I can't move my fingers on will, and I passively move them to keep them going. Even though it is still painful, my fingers are obeying my commands since I began this 30 day journey. Two fingers that before did not move, are bending, albeit slowly, and sometimes get stuck, but they are actively moving. 
I want to continue! Thank you, Adrienne!
@Adrienne: is there a 365 day yoga that you can suggest (with you) when this ends? I don't want this to end.
